INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Quasi quae sint laborum sed omnis.', 'Iusto modi delectus architecto dolor autem dolores tempora. Ut non expedita quidem laboriosam nostrum rerum quia. Ut at neque totam. Inventore explicabo ut maiores assumenda nesciunt omnis. Corporis nemo perferendis et id qui.', 'Voluptate deserunt voluptas laboriosam dolor sint et est accusantium. Dolore earum quo et quia ipsum qui eveniet vitae. Ut at sed quis et sint.', '2012-03-04');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Earum ut ut aliquid repudiandae porro molestiae voluptas.', 'Facilis in illo itaque id nobis officia est. Enim dolor ipsam ullam. Hic officia aut cum voluptatem.', 'Voluptatem necessitatibus molestias id repellat mollitia provident non voluptas. Non voluptatem quis quidem natus atque asperiores dolor.', '1991-06-13');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Fugit neque fugiat perferendis nobis magnam aut alias.', 'Asperiores magni accusamus illo dolorem. Vel natus veritatis illum enim aut corporis vel. Nobis ullam vero quos reprehenderit consequuntur repellat.', 'Asperiores in vitae autem voluptas et minima doloribus odit. Nostrum quo non quisquam quia. Amet voluptates eum aut aut quo dignissimos pariatur.', '1992-04-22');
